import React, {useEffect, useState} from 'react';
import { Card, Skeleton, Row, Col, } from 'antd';
import { UserOutlined, UserAddOutlined } from '@ant-design/icons';
import { Table, Tag, Space, Avatar, Spin, Button } from 'antd';


import './styles.css'
import {io} from 'socket.io-client'

const columns = [
    {
      title: 'Session Name',
      dataIndex: 'name',
      key: 'name',
      render: text => <a style={{color:'white'}}>{text}</a>,
    },
    {
      title: 'Start Time',
      dataIndex: 'start_time',
      key: 'start_time',
    },
    {
      title: 'End Time',
      dataIndex: 'end_time',
      key: 'end_time',
    },
    {
      title: 'Tags',
      key: 'tags',
      dataIndex: 'tags',
      render: tags => (
          <>
            {tags.map(tag => (
              <Tag color="pink" style={{backgroundColor:"transparent", color:'white'}} key={tag}>
                {tag}
              </Tag>
            ))}
          </>
        )
    },

    {
      title: 'Action',
      key: 'action',
      render: (text, record) => (
        <Space size="middle">
          <a>View</a>
        </Space>
      ),
    },
  ];

const User = () => {
    const socket = io("http://localhost:5000")
    socket.on("connect", () => {
        console.log(`You connected with id: ${socket.id}`)
    })
    socket.emit('send-message', 'hi hi this is a message')
    // socket.emit("custom-event", 10, "Hi", {a:"a"})
    socket.on("receive-message", message => {
        console.log(message)
    })
    // const ENDPOINT = 'localhost:5000';
    // useEffect(() => {
    // }, [ENDPOINT])
    return ( 
        <div style={{fontSize:'10px', color:'white'}}>
             <Table 
            pagination={false}
            columns={columns} 
            dataSource={dummy.data} />
            User <UserAddOutlined />
        </div>
     );
}

export default User;
